import React from 'react'; 


function ContactMain () {
    return (
        <div className ="main-contact"> 
            <p className="contact"><b>Email:</b> c.vigil27@gmail.com</p>
            <p className="contact"><b>Mobile:</b> 720-891-6797</p>

            <div className="links">
            <a href="https://www.linkedin.com/in/christalvigil-lillyrose35" target="blank">Connect via LinkedIn</a><br></br>
            <a href="https://github.com/vichrist" target="blank">Connect via GitHub</a><br></br>
            <a href="https://drive.google.com/file/d/1zIq9Tvd7B83r3iHX-V-qKUXPh0811grY/view?usp=sharing" target="blank">Resume</a><br></br>
            <a href="c.vigil27@gmail.com" target="blank">Email</a><br></br>
        </div>
        </div>


      ); 
  };
  
  export default ContactMain;
